      census(
        {
          vintage: 2016,
          geoHierarchy: {
            state: 48,
            county: "*"
          },
          geoResolution: "500k",
          sourcePath: ["cbp"],
          predicates: {
            NAICS2012: 211
          },
          values: ["ESTAB"],
          statsKey: "3c04140849164b373c8b1da7d7cc8123ef71b7ab"
        },
        function(error, response) {
          L.geoJson(response, {
            onEachFeature: function(feature, layer) {
              layer.bindPopup(
                "<h2>" +
                  feature.properties.NAME +
                  "</h2><p># of Oil and Gas Extraction businesses: " +
                  feature.properties.ESTAB +
                  "</p>"
              );
            }
          }).addTo(map);
        }
      );
    </script>
